import classes from "./RoomCard.module.css"

const typeData = [
    {
        text: "Family House",
        value: "Family House"
    },
    {
        text: "House & Villa",
        value: "House & Villa"
    },
    {
        text: "Apartment",
        value: "Apartment"
    },
    {
        text: "Office & Studio",
        value: "Office & Studio"
    },
    {
        text: "Villa & Condo",
        value: "Villa & Condo"
    },
    
]

const RoomCard = props => {
    return (
        <div className={`${classes.shadow}`} key={props.item.index}>
            <div className={classes.img}>
                <img src={props.item.cover} alt='' />
            </div>
            <div className={classes.text}>
                <h4>{typeData[props.item.category].text}</h4>
                <p>
                    <i className='fa fa-location-dot'></i> {props.item.status == 0 ? "available" : "rented"}
                </p>
                <p>
                    <i class="fa fa-money-check"></i> {props.item.totalPrice} / month
                </p>
                <p>
                    <i class="fa fa-info"></i> {props.item.detail}
                </p>
            </div>
            <div className={`${classes.button} ${classes.flex}`}>
                <button className={classes.btn2}>Edit</button>
                <button className={classes.btn3}>Delete</button>
            </div>
        </div>
    )
}

export default RoomCard
